import GridBox from './GridBox'

interface Content {
    photo: string
}

interface Props {
    GridContent: Array<Content>
}

const Grid:React.FC<Props> = (GridContent) => {
    console.log(GridContent.GridContent[0])
    return (
        <ul>
            {GridContent.GridContent.map((content: {}, index) => {
                <GridBox content={Content} ></GridBox>
            })}
        </ul>
    )
};

export default Grid;
